import styled from "styled-components";
import colors from "../../components/colors";

const Wrapper = styled.div`
  max-width: 1080px;
  margin: 4em auto 0;
  color: ${colors.red0};

  .title {
    position: relative;
  }

  .graphic {
    margin: 0 auto;
  }

  h2 {
    position: absolute;
margin: 0;
top: 0; left:0; right:0; bottom: 0;

  }

  .row {
    display: flex;
    justify-content: space-evenly;
    align-items:flex-start;

    img {
      display: block;
    }
  }

`;

export default Wrapper;
